<h1 class="Section4">
<a class="Section5" href="#" id="gestion-des-variables-d-environnement">Gestion des variables d'environnement</a>
</h1>
<div class="Section6"><br>La fonction (qputenv) définit la valeur d'une variable d'environnement nommée. Elle créera la variable si elle n'existe pas. Elle renvoie 0 si la variable n'a pas pu être définie.

L'appel de (qputenv) avec une valeur vide supprime la variable d'environnement sous Windows et la rend définie (mais vide) sous Unix.<br><br>La fonction (qgetenv) renvoie la valeur de la variable d'environnement comme un QByteArray. Si aucune variable de ce nom n'est trouvée dans l'environnement, cette fonction renvoie un résultat QByteArray construit par défaut.<br><br>Les fonctions de manipulation de l'environnement Qt sont thread-safe, mais cela nécessite que les fonctions équivalentes de la bibliothèque C comme (getenv) et (putenv) ne soient pas directement appelées.<br><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Gestion des variables d'environnement:<br>&nbsp;<br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
int main(int argc, char **argv) {
    QApplication lApp(argc, argv);
    GWindow lWindow;
    lWindow.show();
    return lApp.exec();
}
//===============================================
GWindow::GWindow(QWidget *parent)
: QMainWindow(parent)
, ui(new Ui::GWindow) {
    ui-&gt;setupUi(this);
}
//===============================================
void GWindow::on_actionOpen_triggered(bool checked) {
    qputenv("QT_AUTO_SCREEN_SCALE_FACTOR", "1");
    qputenv("QT_ENABLE_HIGHDPI_SCALING", "0");
    qputenv("QT_LOGGING_RULES", "qt.qml.connections=false");
    qputenv("QT_QUICK_CONTROLS_CONF", ":/qtquickcontrols2.conf");

    QString lScaleFactor = qgetenv("QT_AUTO_SCREEN_SCALE_FACTOR");
    QString lHighDpiScaling = qgetenv("QT_ENABLE_HIGHDPI_SCALING");
    QString lLoggingRules = qgetenv("QT_LOGGING_RULES");
    QString lControlsConf = qgetenv("QT_QUICK_CONTROLS_CONF");

    qDebug() &lt;&lt; "QT_AUTO_SCREEN_SCALE_FACTOR-T ²--:" &lt;&lt; lScaleFactor;
    qDebug() &lt;&lt; "QT_ENABLE_HIGHDPI_SCALING-----:" &lt;&lt; lHighDpiScaling;
    qDebug() &lt;&lt; "QT_LOGGING_RULES--------------:" &lt;&lt; lLoggingRules;
    qDebug() &lt;&lt; "QT_QUICK_CONTROLS_CONF--------:" &lt;&lt; lControlsConf;
}
//===============================================</pre><br></div>
