<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="chargement-dynamique-d-un-fichier-qml">Chargement dynamique d'un fichier QML</a>
</h1>
<div class="Section6"><br>QQmlApplicationEngine fournit un moyen pratique de charger une application à partir d'un seul fichier QML.<br><br>Cette classe combine unQQmlEngineetQQmlComponentpour fournir un moyen pratique de charger un seul fichier QML. Il expose également certaines fonctionnalités d'application centrales de QML, qu'une application hybride C++/QML contrôlerait normalement depuis C++.<br><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Chargement dynamique d'un fichier QML:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
int main(int argc, char **argv) {
    QGuiApplication lApp(argc, argv);

    QQmlApplicationEngine lEngine;
    const QUrl url(u"qrc:/qml/main.qml"_qs);
    QObject::connect(
            &amp;lEngine,
            &amp;QQmlApplicationEngine::objectCreated,
            &amp;lApp,
            [url](QObject *obj, const QUrl &amp;objUrl) {
                if(!obj &amp;&amp; url == objUrl)
                    QCoreApplication::exit(-1);
            },
            Qt::QueuedConnection);

    lEngine.load(url);

    if(lEngine.rootObjects().isEmpty()) {
        return -1;
    }

    return lApp.exec();
}
//===============================================</pre><br>Fichier QML:<br>&nbsp;<br><pre class="GCode1 Code1 AceCode" data-mode="qml" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
Window {
    width: 400
    height: 300
    visible: true
    title: qsTr("ReadyApp")
}
//===============================================</pre><br></div>
